import styled from "styled-components";

const SideManu = styled.div`
  box-sizing: border-box;
  width: 240px;
  height: 100%;
  position: fixed;
  top: 0;
  left: 0;
  z-index: 998;
  color: white;
`;

export function Sidebar() {
  return <Sidebar></Sidebar>;
}
